('Omron Blood Pressure Monitor HEM-7156T','359','7','10','Ketoconazole ','{"Perangkat & Peralatan", "Alat Monitoring", "Pengukur Tekanan Darah", "Produk Kesehatan"}','Produk ini merupakan produk Pre Order. Produk akan diterima setelah 8-12 hari pemesanan. \n\nProduk tidak bisa dibatalkan apabila telah dipesan. Alat Monitor Tensi Darah Digital HEM 7156T dari Omron memungkinkan Anda mengelola dan melacak kesehatan jantung secara efektif. Perangkat ini dilengkapi dengan fitur seperti indikator Hipertensi, deteksi detak jantung tidak teratur, 360 Accuracy Intelliwrap Cuff berupa manset yang memudahkan Anda mendapatkan pembacaan akurat dengan mudah di rumah serta fitur konektivitas Bluetooth dengan Omron Connect dapat dihubungkan untuk menyimpan hasil pembacaan dengan Smartphone, sehingga memudahkan anda dalam memberikan Riwayat pengukuran tensi darah kepada dokter.\n\n\n\nFitur Produk:\n\nManset Akurasi Manset IntelliWrap 360 Akurasi klinis yang mudah dan nyaman dari rumah\n\nPanduan Pembungkus Manset\n\nMenyediakan informasi untuk pengguna bahwa manset telah terpasang dengan benar "OK" untuk memastikan pengukuran tekanan darah yang akurat\n\n\n\n\n\nIndikator Gerakan tubuh\n\n\n\nSimbol peringatan yang akan tampil apabila pengguna melakukan gerakan pada saat pengukuran berlangsung. Hal ini dapat mempengaruhi hasil pengukuran.\n\n\n\nIndikator Detak Jantung Tidak Teratur\n\n\n\nDenyut jantung yang tidak teratur adalah ritme detak jantung yang bervariasi lebih dari 25% dari detak jantung rata-rata yang dideteksi saat mengukur tekanan darah.\n\n\n\n1. Jika ritme yang tidak teratur terdeteksi lebih dari dua kali selama pengukuran, simbol detak jantung yang tidak teratur muncul di layar dengan hasil pengukuran.\n\n\n\n2. Jika denyut jantung yang tidak teratur menyebabkan pengukuran menjadi tidak valid, tidak ada hasil yang ditampilkan.\n\n\n\n3. Jika simbol detak jantung tidak teratur ditampilkan setelah Anda melakukan pengukuran, ulangi pengukuran.\n\n\n\n4. Jika simbol tetap muncul setelah dilakukan pengukuran ulang, Kami sarankan anda untuk berkonsultasi dengan dokter anda.\n\n\n\nIndikator Hipertensi\n\n\n\nSimbol detak jantung akan berkedip jika tekanan sistolik atau diastolik Anda berada di luar kisaran standar (di atas 135 sistolik / 85 mmHg diastolik).\n\n\n\nTeknologi IntelliSense\n\n\n\nAlgoritma baru ini meningkatkan akurasi pengukuran dengan deviasi standar kurang dari 4 mmHg. Dengan menekan sebuah tombol, Teknologi IntelliSense yang ditingkatkan memberikan pengukuran yang akurat dengan kenyamanan dan kemudahan penggunaan.\n\n\n\nMemory Penyimpanan 60 Hasil pengukuran Home Care\n\nKonektivitas ke Bluetooth dengan Aplikasi Omron Connect\n\n\n\nIsi Paket Penjualan:\n\n\n\nTensimeter Digital Kit, baterai AA x 4, cuff/manset M to L (22 - 42 cm), buku manual, kartu garansi','29','Per Piece','551.0','6.01','1.58','2.47','https://d2qjkwm11akmwu.cloudfront.net/products/161895_4-9-2024_15-58-28.png','1208','true'),
